export default function Card({onClose,id,name,status,gender,species,image,origin}) {
   return (
      <div>
         <button onClick={()=>onClose(id)}>X</button>
         <h2>{name}</h2>
         <h2>{status}</h2>
         <h2>{species}</h2>
         <h2>{gender}</h2>
         <h2>{origin}</h2>
         <img src={image} alt={name} />
      </div>
   );
}
